Today @olivia_caputo and I had the pleasure of visiting many local Turkish designers’ showrooms, and when we got to @sudietuzofficial, we knew we HAD to shoot!

Each design was so unique and eccentric. We chose this stunning set from the new collection and took it right outside the showroom’s front door to shoot. 

