This morning we were able to visit the world famous Hagia Sophia Grand Mosque in Instanbul, Turkey thanks to @goturkiye 🇹🇷 🕌 Learning about the history of this structure over the years was so interesting but witnessing it in person was more incredible than I could have imagined. Videos just cant do it justice, it was absolutely breathtaking! 

We’ve been blown away visiting this beautiful country, it’s rich culture, and are excited to share with you things that we’ve seen that make it so special. We’re honored to support Turkey to uplift them as a once in a lifetime tourism destination, especially in a time when they need it most 💓

